import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const currDate= new Date().toLocaleDateString();
const curHr = new Date().getHours();

function Welcome(curHr) {

    if ({curHr} < 12) {
        <h1>'good Morning'</h1>
    } else if ({curHr} < 18) {
        <h1>'good afternoon'</h1>
    } else {
      <h1>'good evening'</h1>
    }

    return;
  }

ReactDOM.render(
    <> 
<h1>{`This is Current Date ${currDate}`}</h1>
<h1>{`This is Current Hour ${curHr}`}</h1>
<h1>{`Hello Sir` }</h1>







    </>,

    
document.getElementById('root')
);
